n = len(d)
ans = 333

# top down dp and track path
dp = [[0 for _ in range(n)] for _ in range(n)]
path = [["?" for _ in range(n)] for _ in range(n)]
dp[0][0] = ans
for i in range(1, n):
    dp[0][i] = dp[0][i-1] + d[0][i]
    path[0][i] = "L"
    dp[i][0] = dp[i-1][0] + d[i][0]
    path[i][0] = "U"
for i in range(1, n):
    for j in range(1, n):
        if dp[i-1][j] > dp[i][j-1]:
            dp[i][j] = dp[i-1][j] + d[i][j]
            path[i][j] = "U"
        else:
            dp[i][j] = dp[i][j-1] + d[i][j]
            path[i][j] = "L"

for i in path:
    for j in i:
        print(f"{j:5}", end="")
    print()

# get path from bottom right
i, j = n-1, n-1
actual = []
while i > 0 or j > 0:
    actual.append(path[i][j])
    if path[i][j] == "U":
        i -= 1
    else:
        j -= 1
actual.reverse()
# replace L, U with R, D
for i in range(len(actual)):
    if actual[i] == "L":
        actual[i] = "R"
    else:
        actual[i] = "D"
print(actual)
# sanity check
health = ans
i, j = 0, 0
for dir in actual:
    if dir == "R":
        j += 1
    else:
        i += 1
    health += d[i][j]
    if health <= 0:
        break
assert health == 1 and i == n-1 and j == n-1

